  </Popover>
);

const androidstudio = (
  <Popover>
    <Popover.Title as="h3">Android Studio</Popover.Title>
  </Popover>
);

const burp = (
  <Popover>
    <Popover.Title as="h3">Burp Suite</Popover.Title>
