                    <Card style={{  width: '7rem', height: '7rem', borderRadius: '50%'  }}>
                      <Card.Img variant="top" src={Csharp} />
                    </Card>
                    </OverlayTrigger>
                  <br/>
                  </Col>
                  </Row>
                  <Row className="padded-top">
                  <Col>
                  <OverlayTrigger trigger="click" placement="right" overlay={googlecloud}>
                    <Card style={{  width: '7rem', height: '7rem', borderRadius: '50%'  }}>
                      <Card.Img variant="top" src={GCloud} />
